text:
@in_these_times: there is no doubt this moment calls for a powerful mobilization against the trump administration and the ruling-class, white-supremacist interests it represents. but establishment democrats' strategy of hitching their â€œresistanceâ€ campaign to russiagate is misguided and dangerous. by demanding trump prove heâ€™s tough on russia, the same democrats who warn that trump is dangerous and unhinged are asking him to oversee an even more bellicose foreign policy. the net effect has been to push the u.s. government to take a more confrontational stance toward russia and other geopolitical foes andâ€”ultimatelyâ€”expand its military empire.
whatever one thinks about the aims and scope of russian interference, the evidence is undeniable: democratsâ€™ overwhelming focus on russia has led directly to a significantâ€”and measurableâ€”military buildup. the $716 billion national defense authorization act (ndaa) for 2019 is massive, marking an $81 billion increase over 2017 (adjusted for inflation). the bill explicitly targets russia and china. from the outset, lawmakers on both sides of the aisle cited the threat of russian interference to argue in favor of the ndaa. rep. adam smith (d-wash.), the ranking democrat on the house armed services committee, gushed, â€œthis bill continues the absolutely critical work of pushing back against president putin.â€ smith, who earlier that month called for an impeachment investigation of trump, appeared eager and willing to hand the president a giant check for war.
bipartisan lawmakers handed a major victory to trump by passing the defense bill, which includes $6.5 billion to fully fund the â€œeuropean deterrence initiativeâ€ to build the military capabilities of european states near russia. the legislation also instructs secretary of defense james mattis to conduct a feasibility study on whether a â€œpermanently stationed united states army brigade combat team in poland would enhance deterrence against russian aggression.â€

